import React, { Component } from 'react';

class AddComponent extends Component {
  constructor(props){
    super(props);

    this.state = {
      quayname: '',
      info: '',
      location: ''
    }
  }

  onChangeQuayname = (e) => {
    this.setState({
      quayname: e.target.value
    })
  }

  onChangeInfo = (e) => {
    this.setState({
      info: e.target.value
    })
  }

  onChangeLocation = (e) => {
    this.setState({
      location: e.target.value
    })
  }
}



export default AddQuay;
